import React from "react";

function Nav({ value, onChange }) {
  return (
    <div>
      <input
        type="text"
        placeholder="search"
        value={value}
        onChange={onChange}
      ></input>
      <button>search</button>
      <button>Explore</button>
      <button>Create</button>
      <button>Mypage</button>
      <button>Wallet</button>
    </div>
  );
}

export default Nav;
